      console.log(`Notification job ${job.id} failed: ${err}`);
    });

    job.on('progress', (progress, total) => {
      const percentage = (progress / total) * 100;
      console.log(`Notification job ${job.id} ${Math.round(percentage)}% complete`);
    });
  });
}

